import { Component } from 'react';

class quickSearchBox extends Component {

    render() {
        const  { imageSrc, heading }=this.props;
        return (
                <>
                    <div className="col-12 col-md-6 col-lg-4">
                        <div className="quickSearchBox">
                            <img src={'imageSrc'} width="160" height="160" alt="imager not found" />
                            <div className="quickSearchDesc">
                                <h3>{'heading'}</h3>
                                <p>Start your day with exclusive breakfast options</p>
                            </div>
                        </div>
                    </div>
            </>
        );
    }
}

export default quickSearchBox;
